import React from 'react';
import logo from '../Images/Logo.jpg';
import '../style/Footer.css';

function Footer() {
    return (
        <div>
            <footer className="footerr">
                <div className="containerr">
                    <img src={logo} className="footer-logo" alt="Image" />
                    <p>vaydgawu</p>
                    <div className="roww">
                        <div className="coll">
                            <h4>Resources</h4>
                            <ul>
                                li
                            </ul>
                        </div>
                    </div>
                </div>
            </footer>
        </div>
    )
}

export default Footer;
